  01> BOWERING, Harriot Morvyn
  b 16.04.1977
  Harriot b. at London, England. In 1991 she won the art scholarship at Ascham School Sydney and
  completed her HSC in 1994, receiving the Eisteddfod Costume Design Award. She is currently
  completing her BA at the University of Sydney and is modelling for Mooks Winter Catalogue and
  international ad campaign.
  02> BOWERING, Theodora Frances
  b 25.07.1980
  Theodora b. at London, England. In 1993 she went to Sydney Girls' High School and participated in
  rowing, basketball and hockey. In 1997 she was school representative at the New South Wales Drama
  Camp and Photographic Editor of the SGHS Chronicle. In 1998 she is a school prefect and HSC
  student.
  03> WILLIAMS, Charlotte Hester m on ** ** 1981 to KEMBER, David Greville
  b 24.04.1944
  b 29.09.1947
  Charlotte b. at Wellington. David, s/o Frederick John Kember and Celia Lutzky, b. at Wellington.
  Address: 31 Shannon Street, Mount Victoria, Wellington.
  Charlotte gained a BA (Hons) in Law at Oxford (1965); called to the Bar, Inner Temple (1966); MPA
  Princeton (1974); NZ Ministry of Foreign Affairs (1967-84); Assistant Commissioner, State Services
  Commission (1991); Pro-Chancellor, Lincoln University (1989-95); and Deputy Secretary, Ministry of
  Justice (1993-).
  Charlotte purchased her sisters' shares of "Kumukumu" station in 1990.
